insert  into `clause_content`(`id`,`clause_id`,`is_title`,`title_level`,`content`,`order`,`delete`) values (3425,48,0,'','这是内容吗',1,1),(3426,48,1,'h1','那这就是标题咯',2,1),(3427,50,0,'','200',1,1),(3428,51,0,'','2',1,1),(3429,52,0,'','30',1,1),(3430,53,0,'','4',1,1),(3431,54,0,'','兴仁农商银行办公室文件',0,1),(3432,54,0,'','兴仁农商银办发〔2017〕262号',1,1),(3433,54,0,'','兴仁农商银行办公室关于严禁发放多头贷款的通知',2,1),(3434,54,0,'','各支行：',3,1),(3435,54,0,'','为进一步加强贷款管理，规范贷款操作流程，控制和防范操作风险，提高贷款资产质量，进一步强化制度执行力，结合我行实际，现就严禁发放多头贷款事宜通知如下，请各支行、小微中心严格按要求遵照执行。',4,1),(3436,54,0,'','一、多头贷款的定义',5,1),(3437,54,0,'','根据《贷款通则》第四章第二十条“对借款人的限制”第一点“不得在一个贷款人同一辖区内的两个或两个以上同级分支机构取得贷款”之规定，我行多头贷款指的是同一借款人（含配偶）在我行不同支行、小微中心办理贷款业务（含信用、抵质押贷款等）的，均属于多头贷款。借款人在我行同一支行申请办理多笔、多种类贷款的，不属于多头贷款。',6,1),(3438,54,0,'','二、相关要求',7,1),(3439,54,0,'','从下发通知之日起，严禁发放多头贷款，除办理个人住房按揭贷款不受多头贷款限制外，同一借款人（含配偶）只能在一个支行办理信贷业务，在责任认定过程中，根据贷款发放时间先后顺序，后发放贷款支行属于发放多头贷款。对于认定为发放多头贷款的，除责令发放多头贷款支行限期收回贷款本息外，对发放多头贷款的支行行长罚款3000元，对经办客户经理各罚款2000元，对支行参审人各罚款1000元。',8,1),(3440,54,0,'','本规定从下发之日起执行，原《兴仁农村商业银行关于加强信贷客户综合授信管理的通知》（兴仁农商银发[2015]66号）第一条：“同一信贷客户（包括其配偶，下同）只能在本行一个网点获得信贷业务授信。各支行在授理信贷业务时，除小额农户信用贷款外，应要求客户书面授权查询其信用报告，并根据其信用报告查看在本行其他支行是否有贷款余额。若客户已经在本行其他支行获得贷款，客户经理不得授理信贷业务，建议客户到发放贷款的支行办理”之规定自行废止。',9,1),(3441,54,0,'','兴仁农商银行办公室',10,1),(3442,54,0,'','                                     2017年10月9日',11,1),(3443,54,0,'','                                               共印48份',12,1),(3444,55,0,'','各支行：',0,1),(3445,55,0,'','为进一步加强贷款管理，规范贷款操作流程，控制和防范操作风险，提高贷款资产质量，进一步强化制度执行力，结合我行实际，现就严禁发放多头贷款事宜通知如下，请各支行、小微中心严格按要求遵照执行。',1,1),(3446,55,0,'','一、多头贷款的定义',2,1),(3447,55,0,'','根据《贷款通则》第四章第二十条“对借款人的限制”第一点“不得在一个贷款人同一辖区内的两个或两个以上同级分支机构取得贷款”之规定，我行多头贷款指的是同一借款人（含配偶）在我行不同支行、小微中心办理贷款业务（含信用、抵质押贷款等）的，均属于多头贷款。借款人在我行同一支行申请办理多笔、多种类贷款的，不属于多头贷款。',3,1),(3448,55,0,'','二、相关要求',4,1),(3449,55,0,'','从下发通知之日起，严禁发放多头贷款，除办理个人住房按揭贷款不受多头贷款限制外，同一借款人（含配偶）只能在一个支行办理信贷业务，在责任认定过程中，根据贷款发放时间先后顺序，后发放贷款支行属于发放多头贷款。对于认定为发放多头贷款的，除责令发放多头贷款支行限期收回贷款本息外，对发放多头贷款的支行行长罚款3000元，对经办客户经理各罚款2000元，对支行参审人各罚款1000元。',5,1),(3450,55,0,'','本规定从下发之日起执行，原《兴仁农村商业银行关于加强信贷客户综合授信管理的通知》（兴仁农商银发[2015]66号）第一条：“同一信贷客户（包括其配偶，下同）只能在本行一个网点获得信贷业务授信。各支行在授理信贷业务时，除小额农户信用贷款外，应要求客户书面授权查询其信用报告，并根据其信用报告查看在本行其他支行是否有贷款余额。若客户已经在本行其他支行获得贷款，客户经理不得授理信贷业务，建议客户到发放贷款的支行办理”之规定自行废止。',6,1),(3451,55,0,'','兴仁农商银行办公室',7,1),(3452,55,0,'','                                     2017年10月9日',8,1),(3453,55,0,'','                                               共印48份',9,1),(3454,56,0,'','',0,0),(3455,56,0,'','各支行：',1,0),(3456,56,0,'','为进一步加强贷款管理，规范贷款操作流程，控制和防范操作风险，提高贷款资产质量，进一步强化制度执行力，结合我行实际，现就严禁发放多头贷款事宜通知如下，请各支行、小微中心严格按要求遵照执行。',2,0),(3457,56,0,'','一、多头贷款的定义',3,0),(3458,56,0,'','根据《贷款通则》第四章第二十条“对借款人的限制”第一点“不得在一个贷款人同一辖区内的两个或两个以上同级分支机构取得贷款”之规定，我行多头贷款指的是同一借款人（含配偶）在我行不同支行、小微中心办理贷款业务（含信用、抵质押贷款等）的，均属于多头贷款。借款人在我行同一支行申请办理多笔、多种类贷款的，不属于多头贷款。',4,0),(3459,56,0,'','二、相关要求',5,0),(3460,56,0,'','从下发通知之日起，严禁发放多头贷款，除办理个人住房按揭贷款不受多头贷款限制外，同一借款人（含配偶）只能在一个支行办理信贷业务，在责任认定过程中，根据贷款发放时间先后顺序，后发放贷款支行属于发放多头贷款。对于认定为发放多头贷款的，除责令发放多头贷款支行限期收回贷款本息外，对发放多头贷款的支行行长罚款3000元，对经办客户经理各罚款2000元，对支行参审人各罚款1000元。',6,0),(3461,56,0,'','本规定从下发之日起执行，原《兴仁农村商业银行关于加强信贷客户综合授信管理的通知》（兴仁农商银发[2015]66号）第一条：“同一信贷客户（包括其配偶，下同）只能在本行一个网点获得信贷业务授信。各支行在授理信贷业务时，除小额农户信用贷款外，应要求客户书面授权查询其信用报告，并根据其信用报告查看在本行其他支行是否有贷款余额。若客户已经在本行其他支行获得贷款，客户经理不得授理信贷业务，建议客户到发放贷款的支行办理”之规定自行废止。',7,0),(3462,56,0,'','',8,0),(3463,56,0,'','兴仁农商银行办公室',9,0),(3464,56,0,'','                                     2017年10月9日',10,0),(3465,56,0,'','',11,0),(3466,56,0,'','                                               共印48份',12,0),(3467,56,0,'','',13,0),(3468,56,0,'','',14,0),(3469,57,0,'','根据《省联社办公室关于开展2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（黔农信办发〔2018〕392号）及《兴仁农商银行办公室关于印发2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（兴仁农商银办发〔2018〕245号 ）中“印章管理”排查要求，总行办公室决定在各支行对印章管理进行自查后，在辖内进行抽查，现将相关事宜通知如下：',0,1),(3470,57,0,'','一、排查内容',1,1),(3471,57,0,'','截止2018年7月末，近1年内行政印章及柜面印章管理和使用情况。',2,1),(3472,57,0,'','二、排查要点',3,1),(3473,57,0,'','（一）行政用章管理',4,1),(3474,57,0,'','1.建立《印章使用登记簿》、《印章交接登记簿》、《印章借用登记簿》等，并根据实际情况，记录相关要素。',5,1),(3475,57,0,'','2.印章实行专人管理，按照“双人制度”，保管时要密码钥匙分离管理。',6,1),(3476,57,0,'','3.印章必须使用保险柜保管，不得随意放置，做到随用随取、人离章收。',7,1),(3477,57,0,'','4.印章管理员变更或因事需交接印章时，要办理交接和登记手续。',8,1),(3478,57,0,'','5.严格履行用印审批手续，凡需加盖印章的文字材料或表格，由支行行长签批。',9,1),(3479,57,0,'','6.违规用印情况,有下列情况的不予用印：',10,1),(3480,57,0,'','（1）未经有权审批人批准的；',11,1),(3481,57,0,'','（2）用印材料与审批情况不一致的；',12,1),(3482,57,0,'','（3）法律性文本用印未按规定提供法律审查意见的；',13,1),(3483,57,0,'','（4）空白页、空白表格；',14,1),(3484,57,0,'','（5）关键信息缺失、字迹模糊的材料；',15,1),(3485,57,0,'','（6）其他有正当理由拒绝用印的情形。',16,1),(3486,57,0,'','7.严格实行登记制度，印章登记簿应记载用印时间、经办人、事由、份数、审批人等关键信息。',17,1),(3487,57,0,'','8.非特殊工作需要，印章原则上不得离行使用，确需带出的，必须报主要负责人批准，由双人带出用印。',18,1),(3488,57,0,'','9.定期开展印章管理自查。',19,1),(3489,57,0,'','    （二）柜面用章管理    ',20,1),(3490,57,0,'','1.刻制的印章要按柜面印章的种类刻制，不得擅自新增和修改柜面业务印章。',21,1),(3491,57,0,'','2.各支行柜面印章要按规定范围使用，不得错用、串用、提前或过期使用会计业务印章，不得未办理交接手续将柜面业务印章交他人使用，不得预先在重要空白凭证上加盖印章备用。',22,1),(3492,57,0,'','3.各支行要按规定对印章管理进行检查，至少每半年自查一次，印章登记簿与印章实物是否相符。',23,1),(3493,57,0,'','4.柜面业务印章使用人要做到“专匣保管、固定存放，人离章收。”临时离岗，应入柜（或箱）保管，入屉上锁，钥匙随身带走；营业终了，入库保管。',24,1),(3494,57,0,'','三、相关要求',25,1),(3495,57,0,'','（一）各支行及时组织开展印章管理自查，形成印章管理自查报告，连同印章管理相关登记簿（内页而不是封面）拍照打包于9月27日前报办公室。',26,1),(3496,57,0,'','（二）对在自查中发现的问题，各支行应查缺补漏，及时进行整改。',27,1),(3497,57,0,'','（三）办公室将根据各支行的自查情况进行抽查。',28,1),(3498,57,0,'','',29,1),(3499,57,0,'','兴仁农商银行办公室',30,1),(3500,57,0,'','                               2018年9月26日',31,1),(3501,57,0,'','',32,1),(3502,58,0,'','',0,1),(3503,58,0,'','各支行：',1,0),(3504,58,0,'','根据《省联社办公室关于开展2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（黔农信办发〔2018〕392号）及《兴仁农商银行办公室关于印发2018年“规范年”及深化“合规管理年”活动相关排查工作实施方案的通知》（兴仁农商银办发〔2018〕245号 ）中“印章管理”排查要求，总行办公室决定在各支行对印章管理进行自查后，在辖内进行抽查，现将相关事宜通知如下：',2,0),(3505,58,0,'','一、排查内容',3,0),(3506,58,0,'','截止2018年7月末，近1年内行政印章及柜面印章管理和使用情况。',4,0),(3507,58,0,'','二、排查要点',5,0),(3508,58,0,'','（一）行政用章管理',6,0),(3509,58,0,'','1.建立《印章使用登记簿》、《印章交接登记簿》、《印章借用登记簿》等，并根据实际情况，记录相关要素。',7,0),(3510,58,0,'','2.印章实行专人管理，按照“双人制度”，保管时要密码钥匙分离管理。',8,0),(3511,58,0,'','3.印章必须使用保险柜保管，不得随意放置，做到随用随取、人离章收。',9,0),(3512,58,0,'','4.印章管理员变更或因事需交接印章时，要办理交接和登记手续。',10,0),(3513,58,0,'','5.严格履行用印审批手续，凡需加盖印章的文字材料或表格，由支行行长签批。',11,0),(3514,58,0,'','6.违规用印情况,有下列情况的不予用印：',12,0),(3515,58,0,'','（1）未经有权审批人批准的；',13,0),(3516,58,0,'','（2）用印材料与审批情况不一致的；',14,0),(3517,58,0,'','（3）法律性文本用印未按规定提供法律审查意见的；',15,0),(3518,58,0,'','（4）空白页、空白表格；',16,0),(3519,58,0,'','（5）关键信息缺失、字迹模糊的材料；',17,0),(3520,58,0,'','（6）其他有正当理由拒绝用印的情形。',18,0),(3521,58,0,'','7.严格实行登记制度，印章登记簿应记载用印时间、经办人、事由、份数、审批人等关键信息。',19,0),(3522,58,0,'','8.非特殊工作需要，印章原则上不得离行使用，确需带出的，必须报主要负责人批准，由双人带出用印。',20,0),(3523,58,0,'','9.定期开展印章管理自查。',21,0),(3524,58,0,'','    （二）柜面用章管理    ',22,0),(3525,58,0,'','1.刻制的印章要按柜面印章的种类刻制，不得擅自新增和修改柜面业务印章。',23,0),(3526,58,0,'','2.各支行柜面印章要按规定范围使用，不得错用、串用、提前或过期使用会计业务印章，不得未办理交接手续将柜面业务印章交他人使用，不得预先在重要空白凭证上加盖印章备用。',24,0),(3527,58,0,'','3.各支行要按规定对印章管理进行检查，至少每半年自查一次，印章登记簿与印章实物是否相符。',25,0),(3528,58,0,'','4.柜面业务印章使用人要做到“专匣保管、固定存放，人离章收。”临时离岗，应入柜（或箱）保管，入屉上锁，钥匙随身带走；营业终了，入库保管。',26,0),(3529,58,0,'','三、相关要求',27,0),(3530,58,0,'','（一）各支行及时组织开展印章管理自查，形成印章管理自查报告，连同印章管理相关登记簿（内页而不是封面）拍照打包于9月27日前报办公室。',28,0),(3531,58,0,'','（二）对在自查中发现的问题，各支行应查缺补漏，及时进行整改。',29,0),(3532,58,0,'','（三）办公室将根据各支行的自查情况进行抽查。',30,0),(3533,58,0,'','',31,1),(3534,58,0,'','兴仁农商银行办公室',31,0),(3535,58,0,'','                               2018年9月26日',32,0),(3536,58,0,'','',34,1),(3537,59,0,'','第二条  本办法所称贷款人是指各县（市、区）农村信用合作联社、农村商业银行 (以下统称行社)及其授权办理农户贷款的分支机构（以下简称网点）。',0,1),(3538,59,0,'','第三条  本办法所称农户贷款，是指贷款人向符合条件的农户发放的用于生产经营、生活消费等用途的人民币贷款。',1,1),(3539,59,0,'','本办法所称农户是指长期居住在乡镇和城关镇所辖行政村的住户、国有农场的职工和农村个体工商户。',2,1),(3540,59,0,'','第四条  农户贷款实行“差异授信、灵活定价、风险可控、流程简化、特色服务”的信贷支农服务政策。',3,1),(3541,59,0,'','第五条  贷款人按照“先评级、后授信、再用信”的流程管理农户贷款。针对不同的农户贷款产品，可以采取差异化的办理流程。',4,1),(3542,59,0,'','第六条  贷款人经营农户贷款业务，应遵守本办法。',5,1),(3543,59,0,'','',6,1),(3544,59,1,'h1','第二章  管理架构及职责',7,1),(3545,59,0,'','第七条  行社成立农户贷款管理委员会，经营层负责人任组长，分管领导任副组长，业务、财会、风险、稽核等部门负责人为成员，办公室设在农户贷款业务主管部门。工作职责如下：',8,1),(3546,59,0,'','（一）贯彻落实农村经济金融政策，加大服务“三农”力度。',9,1),(3547,59,0,'','（二）制定行社农户贷款业务发展规划，改进服务方式，提升服务质量，提高农户的满意度和获得感。',10,1),(3548,59,0,'','（三）研究制定农户贷款产品、渠道、营销等策略，不断夯实农村市场。',11,1),(3549,59,0,'','（四）加强农户贷款风险管控研究分析，有效防控农户贷款业务风险。',12,1),(3550,59,0,'','（五）科学合理配置农户贷款业务客户经理、经费等资源，支持农户贷款业务健康发展。',13,1),(3551,59,0,'','（六）督促网点成立农户信用等级评定小组和农户授信审批小组，持续监测履职效能，提升和完善服务机制，不断增强服务能力和水平。',14,1),(3552,59,0,'','（七）每半年至少召开一次农户贷款业务专题会，就信贷政策、信用工程、风险管控及评级授信、利率定价、线上放贷、经验做法和存在问题等情况进行专题研究，提出合理化的工作措施，推动工作质效持续提升。',15,1),(3553,59,1,'h1','第三章  贷款条件、用途和种类',16,1),(3554,59,0,'','第八条  贷款条件。借款人应具备以下条件：',17,1),(3555,59,0,'','（一）借款人在18周岁以上，具有完全民事行为能力且身体健康的自然人。',18,1),(3556,59,0,'','（二）居住在贷款人服务区域内的农户且在本地拥有自有住房或固定的生产经营场所。',19,1),(3557,59,0,'','（三）所从事的生产经营活动符合法律法规及产业政策。',20,1),(3558,59,0,'','（四）贷款申请数额、期限合理，符合生产经营活动、消费行为的合理需求。',21,1),(3559,59,0,'','（五）具有按期偿还贷款本息的能力。',22,1),(3560,59,0,'','（六）借款人遵纪守法，品行良好，无恶意逃废债务行为，无重大不良信用记录。',23,1),(3561,59,0,'','（七）贷款发放前，在贷款人处开立个人银行结算账户，自愿接受信贷监督和支付结算监督。',24,1),(3562,59,0,'','（八）贷款人要求的其他条件。',25,1),(3563,59,0,'','第九条  贷款用途。农户贷款应当符合法律法规规定和国家有关政策，不得发放无指定用途的农户贷款。按照用途分类，农户贷款分为农户生产经营贷款和农户消费贷款。',26,1),(3564,59,0,'','（一）农户生产经营贷款是指贷款人发放给农户用于生产经营活动的贷款，包括农户农、林、牧、渔业生产经营贷款和农户就业创业等其他生产经营贷款。',27,1),(3565,59,0,'','（二）农户消费贷款是指贷款人发放给农户用于生活消费、建房、医疗、教育等需求的贷款。',28,1),(3566,59,0,'','第十条  贷款种类。按信用形式分类，农户贷款包括但不限于：',29,1),(3567,59,0,'','（一）农户小额信用贷款。',30,1),(3568,59,0,'','（二）农户保证贷款（含农户最高额保证贷款、农户联保贷款）。',31,1),(3569,59,0,'','（三）农户抵押贷款（含农户最高额抵押贷款）。',32,1),(3570,59,0,'','（四）农户质押贷款（含农户最高额质押贷款）。',33,1),(3571,59,0,'','（五）组合担保贷款等。',34,1),(3572,59,0,'','',35,1),(3573,59,1,'h1','第四章  贷款方式',36,1),(3574,59,0,'','第十一条  贷款方式。',37,1),(3575,59,0,'','农户贷款方式在有效防控风险的前提下，可采用信用、保证、抵押、质押、组合担保等方式。以企业法人、融资性担保机构和其他经济组织或政策规定可以作为担保人的，执行有关规定。',38,1),(3576,59,0,'','第十二条  采取担保方式办理农户贷款的，担保人、抵（质）押物应符合《中华人民共和国担保法》《中华人民共和国物权法》等国家法律法规的相关规定。',39,1),(3577,59,0,'','第十三条  以农户为保证人的，原则上保证人为贷款人评定的信用农户，且符合贷款人的其他规定。',40,1),(3578,59,0,'','',41,1),(3579,59,1,'h1','第五章  贷款期限、利率与还款方式',42,1),(3580,59,0,'','第十四条  贷款期限。',43,1),(3581,59,0,'','贷款人应根据贷款项目生产销售周期、经营周期和综合还款能力及意愿等因素合理确定。',44,1),(3582,59,0,'','第十五条  贷款利率。',45,1),(3583,59,0,'','贷款人应按照贷款利率覆盖风险及信用状况与利率挂钩的原则，综合考虑信用状况、贷款方式、风险水平、存款贡献、业务往来等要素及农户生产经营利润率和支农惠农要求，合理确定差别化贷款利率。',46,1),(3584,59,0,'','第十六条  还款方式。',47,1),(3585,59,0,'','农户贷款还款方式根据贷款种类、期限及借款人现金流情况，可采用分期还本付息、分期还息到期还本、利随本清、等额本金、等额本息等合理确定。1年期以上贷款不得采用利随本清方式。',48,1),(3586,59,0,'','',49,1),(3587,59,1,'h1','第六章  受理与调查',50,1),(3588,59,0,'','第十七条  农户贷款操作流程：调查、建档、评级、授信、贷款发放、贷后管理。',51,1),(3589,59,0,'','第十八条  农户小额信用贷款按照“一次核定、随用随贷、余额控制、周转使用、动态管理”的模式进行管理，在确定信用授信限额后实行柜面放贷或线上渠道办贷；农户其他贷款按照“逐笔申请、逐笔审批发放”的模式进行管理。针对乡村振兴特色优势农业产业贷款，可以适当采取批量授信、快速审批模式进行管理。行社应根据实际情况制定贷款管理审批权限。',52,1),(3590,59,0,'','第十九条  农户申请贷款除以书面形式提出贷款申请外，还需提供能够证明其符合贷款条件的相关资料。',53,1),(3591,59,0,'','第二十条  贷款受理。',54,1),(3592,59,0,'','贷款人收到借款申请资料后，应在规定时限内及时受理，并履行尽职调查职责，对贷款申请内容和相关情况的真实性、准确性、完整性进行调查核实，对信用状况、风险、收益进行评价，形成调查评价意见。',55,1),(3593,59,0,'','第二十一条  贷前调查应包括但不限于下列内容：',56,1),(3594,59,0,'','（一）提交的资料是否完整、真实、有效。',57,1),(3595,59,0,'','（二）借款申请人经营管理能力、生产经营状况、近期主要收入支出。',58,1),(3596,59,0,'','（三）借款用途是否真实。',59,1),(3597,59,0,'','（四）项目预期风险收益情况。',60,1),(3598,59,0,'','（五）借款申请人还款来源、还款能力、还款意愿及还款方式。',61,1),(3599,59,0,'','（六）借款申请人借款方式、担保人担保意愿、担保能力或抵（质）押物价值及变现能力。',62,1),(3600,59,0,'','（七）核实抵（质）押物的权属及各项权证真实性等情况。',63,1),(3601,59,0,'','（八）原则上须查询借款申请人、担保人的个人信用信息基础数据库情况。',64,1),(3602,59,0,'','（九）对客户提供的复印件应与原件核对一致，由调查人员在复印件上签署“与原件核对相符”字样，调查人员须签署个人姓名确认。',65,1),(3603,59,0,'','第二十二条  贷前调查应当深入了解借款人收支、经营情况，以及人品、信用等信息。严格执行双人调查、实地调查制度，并与借款申请人及其家庭成员进行面谈，形成面谈记录。有效借助村委会、德高望重村民、经营共同体带头人等社会力量及其他客观真实的凭证或证明材料，准确了解借款申请人的基本情况、信用及经营状况。',66,1),(3604,59,0,'','第二十三条  信贷调查结束后，调查人员应根据调查情况，出具明确的调查意见。',67,1),(3605,59,0,'','第二十四条  授信额度。',68,1),(3606,59,0,'','（一）信用授信额度。以农户及家庭信誉为基础，综合家庭基本情况、家庭资产、家庭收入、业务往来、道德品质、信用记录、公共记录等情况合理核定。',69,1),(3607,59,0,'','（二）担保类授信额度。应根据农户信用记录、偿债意愿、偿债能力、担保情况、贷款情况、贷款用途等合理核定。',70,1),(3608,59,0,'','第二十五条  贷款额度。',71,1),(3609,59,0,'','根据农户经营项目、消费种类的用途、实际投入、自有资金及综合偿债能力情况合理确定。',72,1),(3610,59,0,'','',73,1),(3611,59,1,'h1','第七章  审查、风险评价与审批',74,1),(3612,59,0,'','第二十六条  审查及风险评价。',75,1),(3613,59,0,'','（一）贷款审查。行社信贷业务管理部门（授信审批部门）承担信贷业务的合规性审查职责，合规性审查主要审查行业准入政策、借款人主体资格、基本资料、资产负债、评级授信、贷款用途、担保等情况，审查人员审查结束后应出具明确的合规性审查意见或报告，并签字确认。',76,1),(3614,59,0,'','1.审查人员应对申报资料的完整性、有效性、一致性，以及借款人的主体资格、信贷业务的合规合法性进行审查，并对借款人的财务状况、经营管理情况、信贷业务的可行性、风险状况、效益情况作出评价。',77,1),(3615,59,0,'','2.对不符合国家产业政策、信贷政策或存在其他重大问题的，审查人员可直接将申报资料退回。',78,1),(3616,59,0,'','3.审查通过的，审查人员应出具合规性审查意见；资料不完整的应及时反馈，并要求补充完善相关资料和信息。',79,1),(3617,59,0,'','（二）风险评价。风险管理部门承担信贷业务的风险评价职责。有效识别各类风险，重点对可能影响信贷业务风险的因素进行评价，同时提出风险管控意见或措施，出具客观、详实的风险评价报告。',80,1),(3618,59,0,'','1.小额授信业务和低风险业务的风险评价可由本级合规性审查人员一并完成。',81,1),(3619,59,0,'','2.大额授信业务和高风险业务由信贷业务管理部门（授信审批部门）进行合规性审查后，再由风险管理部门进行风险评价。',82,1),(3620,59,0,'','3.各行社应根据自身业务发展规模、风险防控能力、经营管理水平，合理确定小额授信业务、大额授信业务、高风险业务的边界和范围。',83,1),(3621,59,0,'','（三）信贷业务管理部门（授信审批部门）、风险管理部门应独立介入合规性审查和风险评价工作，应根据不同业务品种特点，按照职责对提交的授信资料和调查意见进行合规性审查及风险评价。审查评价过程中有疑问的，审查人可要求补充或完善相关资料，必要时可独立进行现场核查。',84,1),(3622,59,0,'','（四）小额授信业务和低风险业务仅需出具审查意见，大额授信业务和高风险业务须出具合规性审查报告和风险评价报告，合规性审查人员和风险评价人员对报告内容的真实性、完整性、有效性负责。',85,1),(3623,59,0,'','第二十七条  贷款审批。',86,1),(3624,59,0,'','合规性审查及风险评价完成后，将合规性审查及风险评价意见（报告）与申报资料一并提交有权审批人审批。审批人在充分审阅申报资料的基础上，根据国家有关宏观经济政策、法律法规、贵州省农村信用社的信贷规章制度等，按照效益覆盖风险和成本的原则，独立行使审批决策权。',87,1),(3625,59,0,'','（一）审批方式。贷款人应根据待审议事项的复杂程度，按照“风险控制、效率兼顾”的原则，可以采取会议审批，会签审批，专职审批人审批，独立审批等方式。',88,1),(3626,59,0,'','（二）审批结论反馈。经审批通过的授信业务，要及时以书面形式批复，申报网点要严格按照审批结论办理。审批结论为“同意”（含限制性条件同意）的，在落实好附加条件后即可办理具体信贷业务。审批未通过的，可直接将申报资料退回。',89,1),(3627,59,0,'','',90,1),(3628,59,1,'h1','第八章  发放与支付',91,1),(3629,59,0,'','第二十八条  落实用款条件。根据审批意见和约定事项，与借款人协商落实用款条件。用款条件包括：',92,1),(3630,59,0,'','（一）借款人已在贷款人处开立个人银行结算账户。',93,1),(3631,59,0,'','（二）担保措施已有效落实。',94,1),(3632,59,0,'','（三）与借款人约定的其他条件已经满足。',95,1),(3633,59,0,'','第二十九条  签订合同。经审批同意的贷款，贷款人应加强对借款人的身份审验，确认借款人与指定账户真实性，防范假名、借名、冒名贷款问题。根据审批意见和有关规定与借款人、担保人（抵押人、出质人或保证人）当面签订书面借款合同、担保合同及其他相关协议。面签要求如下：',96,1),(3634,59,0,'','（一）在签订有关法律文书前，贷款人应充分履行告知义务。',97,1),(3635,59,0,'','（二）在签订有关法律文书时，应当面核验签约人身份证明，由签约人当场签字加盖手印。',98,1),(3636,59,0,'','第三十条  合同使用。',99,1),(3637,59,0,'','（一）农户小额信用贷款统一使用《贵州省农村信用社自然人最高额循环借款合同》。',100,1),(3638,59,0,'','（二）农户其他贷款，根据借款方式，相应签订借款合同及担保合同。',101,1),(3639,59,0,'','第三十一条  借款合同生效后，贷款人应当遵循审贷与放贷分离的原则，加强对贷款的发放管理，设立独立的放款管理部门或岗位，负责落实放款条件，对满足约定条件的借款人发放贷款。',102,1),(3640,59,0,'','第三十二条  支付管理。有下列情形之一的农户贷款，经贷款人同意可以采取借款人自主支付：',103,1),(3641,59,0,'','（一）农户生产经营贷款且金额不超过50万元，或用于农副产品收购等无法确定交易对象的。',104,1),(3642,59,0,'','（二）农户消费贷款且金额不超过30万元。',105,1),(3643,59,0,'','（三）借款人交易对象不具备有效使用非现金结算条件的。',106,1),(3644,59,0,'','（四）法律法规规定的其他情形。',107,1),(3645,59,0,'','鼓励采用贷款人受托支付方式向借款人交易对象进行支付。',108,1),(3646,59,0,'','第三十三条  采用借款人自主支付的，贷款人应当与借款人在借款合同中明确约定；贷款人应当通过账户分析或现场调查等方式，核查贷款使用是否符合约定用途。',109,1),(3647,59,0,'','第三十四条  贷款发放时，必须将款项转入指定的借款人结算账户，严禁以现金方式发放贷款，确保资金发放给真实借款人。',110,1),(3648,59,0,'','',111,1),(3649,59,1,'h1','第九章  贷后管理',112,1),(3650,59,0,'','第三十五条  贷后检查。',113,1),(3651,59,0,'','（一）贷款发放半年内应开展首次贷后检查。原则上贷款到期前每年检查不低于两次，行社可根据贷款额度大小、产业风险特点、贷款管理能力等因素，合理确定农户贷款贷后检查频度。',114,1),(3652,59,0,'','（二）贷后检查方式分为现场检查和非现场检查，对于借款人能够正常还本付息的，可通过非现场方式进行检查；非现场检查发现借款人还本付息不正常或以下情形之一的，应及时进行现场检查。',115,1),(3653,59,0,'','1.借款人无故逃逸、隐匿、被司法机关羁押、逮捕等。',116,1),(3654,59,0,'','2.借款人存在违法经营行为。',117,1),(3655,59,0,'','3.借款人生产经营不正常，资产明显减少，还款能力明显降低，影响贷款偿还的。',118,1),(3656,59,0,'','4.借款人死亡或家庭主要关系人发生经济纠纷的。',119,1),(3657,59,0,'','5.拒绝接受贷款监督，挪用贷款或转移收入、资产，贷款逾期，拖欠利息等行为。',120,1),(3658,59,0,'','6.其他重大风险事项。',121,1),(3659,59,0,'','（三）检查情况填写贷后检查表或撰写贷后检查报告。',122,1),(3660,59,0,'','第三十六条  日常监测。在贷后检查过程中或通过其他渠道，发现借款人有第三十五条第（二）款规定情形之一的，应及时提出有效的风险控制措施，并以书面形式向网点负责人报告。',123,1),(3661,59,0,'','第三十七条  风险预警。贷款人应当建立风险预警制度，定期跟踪分析评估借款人履行借款合同约定内容以及抵质押担保情况，及时发现借款人、担保人的潜在风险并发出预警提示，采取增加抵质押担保、调整授信额度、提前收回贷款等措施，并作为后续信用评价的基础。',124,1),(3662,59,0,'','第三十八条  贷款收回。短期贷款到期1个星期之前、中长期贷款到期1个月之前，贷款人以书面、电话、短信等形式提示借款人、担保人按时归还贷款本息。',125,1),(3663,59,0,'','第三十九条  贷款展期。对于因自然灾害、农产品价格波动等客观原因造成借款人无法按原定期限正常还款的，由借款人申请，经贷款人同意，可以对还款意愿良好、预期现金流量充分、具备还款能力的农户贷款进行合规展期。申请保证贷款、抵押贷款、质押贷款展期的，还应当由保证人、抵押人、出质人出具同意的书面证明。已有约定的，按照约定执行。已展期贷款不得再次展期。短期贷款展期期限不得超过原贷款期限;中期贷款展期期限不得超过原贷款期限的一半;长期贷款展期期限不得超过3年。',126,1),(3664,59,0,'','第四十条  资产保全。贷款人对逾期贷款应当及时催收，按逾期时间长短和风险程度逐级上报处理，掌握借款人动态，及时采取措施保全信贷资产安全。',127,1),(3665,59,0,'','第四十一条  贷款重组。对于未按照借款合同约定收回的贷款，应当采取措施进行清收，也可以在利息还清、本金部分偿还、原有担保措施不弱化等情况下协议重组。',128,1),(3666,59,0,'','第四十二条  贷款核销。对确实无法收回的农户贷款，贷款人可以按照相关规定进行核销，按照账销案存原则继续向借款人追索或进行市场化处置，并按责任制和容忍度规定，落实有关人员责任。',129,1),(3667,59,0,'','第四十三条  风险分类。贷款人严格按照风险分类的规定，对农户贷款进行准确分类及动态调整，真实反映贷款形态。展期贷款最高列入关注类进行管理。',130,1),(3668,59,0,'','第四十四条  行社风险管理部门、审计部门等部门应当对分支机构贷后管理情况进行检查。建立贷款本息独立对账制度、不定期重点检（抽）查制度以及至少两年一次的全面交叉核查制度，重点排查防范假名、借名、冒名贷款。',131,1),(3669,59,0,'','',132,1),(3670,59,1,'h1','第十章  档案管理',133,1),(3671,59,0,'','第四十五条  农户贷款档案实行电子化管理与纸质档案管理相结合。具有法律文书性质的纸质信贷档案由行社妥善保管并扫描至信贷管理系统对应功能模块系统存储。有价单证、抵押登记凭证、权利证书等重要凭证应视同现金入库保管，并记载登记簿。',134,1),(3672,59,0,'','',135,1),(3673,59,1,'h1','第十一章  激励与约束',136,1),(3674,59,0,'','第四十六条  行社要以风险调整收益为基础，制定农户贷款可持续发展的绩效薪酬管理制度，绩效薪酬考核权重应当对农户贷款业务予以倾斜，体现多劳多得、效益与风险挂钩的激励约束要求。',137,1),(3675,59,0,'','第四十七条  行社应当以支持农户贷款发展为基础，建立科学合理的农户贷款定期考核制度，对农户贷款的服务、管理、质量等情况进行考核，并给予一定的容忍度。主要考核指标包括但不限于：',138,1),(3676,59,0,'','（一）农户贷款户数、金额（累放、累收及新增）、工作量、农户贷款占比等服务指标。',139,1),(3677,59,0,'','（二）农户贷款到期本金回收率、利息回收率及增减变化等管理指标。',140,1),(3678,59,0,'','（三）农户贷款不良率、不良贷款迁徙率及增减变化等质量指标。',141,1),(3679,59,0,'','第四十八条  贷款人开展农户贷款业务应当维护借款人权益，严禁向借款人预收利息、收取账户管理费用、搭售金融产品等不规范经营行为。',142,1),(3680,59,0,'','第四十九条  行社应当建立包含农户贷款业务在内的尽职免责制度、违法违规处罚制度和容忍度机制。尽职无过错，且风险在容忍度范围内的，应当免除责任；超过容忍度范围的，相关人员应当承担失职责任；违规办理贷款的，应当严肃追责处罚。',143,1),(3681,59,0,'','第五十条  贷款人内部工作人员违规处罚。贷款人应加强农户贷款的贷前、贷中及贷后管理，若有以下情形之一的，应视情节轻重，按照省联社员工违规行为处罚相关规定、行业规章及法律法规进行处罚：',144,1),(3682,59,0,'','（一）与借款人串通，发放假名、借名、冒名贷款，骗取贷款人贷款的。',145,1),(3683,59,0,'','（二）违规设置贷款条件办理贷款，直接或间接参与借款人经营、入股分红、占用或变相占用借款人信贷资金的。',146,1),(3684,59,0,'','（三）利用职务上的便利，索取、收受贿赂或者违反国家规定收受各种名义的回扣、手续费的。',147,1),(3685,59,0,'','（四）参与非法集资、发放高利贷的。',148,1),(3686,59,0,'','（五）应予处罚的其他情形。',149,1),(3687,59,0,'','第五十一条  贷款人要建立优质农户与诚信客户正向激励制度，对存款贡献度大、按期还款、信用良好的借款人可采取利率优惠、利息返还、信用累积奖励等方式，促进信用环境不断改善。',150,1),(3688,59,0,'','第五十二条  借款人贷款违约责任。有以下情形之一的，应视情节轻重，对借款人采取取消信用等级及授信额度、停止发放新贷款、限期收回已发放贷款等处理措施；情节严重的，通过司法程序处理：',151,1),(3689,59,0,'','（一）借款人采取欺骗手段，假名、借名、冒名骗取贷款的。',152,1),(3690,59,0,'','（二）借款人故意隐瞒贷款真实用途，将信贷资金挪作民间借贷、高利贷、非法集资等非法用途的。',153,1),(3691,59,0,'','（三）法律法规规定的应予处罚的其他情形。',154,1),(3692,59,0,'','',155,1),(3693,59,1,'h1','第十二章  附  则',156,1),(3694,59,0,'','第五十三条  本办法由省联社负责解释、修订。',157,1),(3695,59,0,'','第五十四条  本办法自印发之日起施行。《省联社办公室关于印发贵州省农村信用社“致富通”农户贷款管理办法的通知》（黔农信办发〔2013〕178号)同时废止。',158,1),(3696,59,0,'','',159,1),(3697,59,0,'','',160,1),(3698,59,0,'','',161,1),(3699,59,0,'','',162,1),(3700,59,0,'','',163,1),(3701,59,0,'','',164,1),(3702,59,0,'','',165,1),(3703,59,0,'','',166,1),(3704,59,0,'','',167,1),(3705,59,0,'','',168,1),(3706,59,0,'','',169,1),(3707,59,0,'','',170,1),(3708,59,0,'','',171,1),(3709,59,0,'','',172,1),(3710,59,0,'','',173,1),(3711,59,0,'','',174,1),(3712,59,0,'','',175,1),(3713,59,0,'','',176,1),(3714,59,0,'','',177,1),(3715,59,0,'','',178,1),(3716,59,0,'','',179,1),(3717,59,0,'','共印120份',180,1);

/*Table structure for table `clause_file` */

DROP TABLE IF EXISTS `clause_file`;

CREATE TABLE `clause_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `clause_id` int(11) DEFAULT NULL COMMENT '管理办法ID',
  `file_id` int(11) DEFAULT NULL COMMENT '附件ID',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除（0未删|1已删）',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;

/*Data for the table `clause_file` */

/*Table structure for table `confirmation` */

DROP TABLE IF EXISTS `confirmation`;

CREATE TABLE `confirmation` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '确认书ID',
  `draft_id` int(11) NOT NULL DEFAULT '0' COMMENT '工作底稿ID',
  `confirmation_receipt_id` int(11) NOT NULL DEFAULT '0' COMMENT '确认书回执ID',
  `file_id` int(11) DEFAULT '0' COMMENT '图片ID',
  `has_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已读（0未读|1已读）',
  `has_read_time` timestamp NULL DEFAULT NULL COMMENT '已读时间',
  `proposal` varchar(2000) DEFAULT NULL COMMENT '单位意见或者建议',
  `state` enum('draft','publish') NOT NULL DEFAULT 'draft' COMMENT '状态（draft草稿|publish发布）',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `year` year(4) DEFAULT NULL COMMENT '年份',
  `number` int(11) DEFAULT NULL COMMENT '编号',
  `author_id` int(11) DEFAULT NULL COMMENT '创建人id',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除（0未删|1删除）',
  PRIMARY KEY (`id`),
  KEY `工作底稿` (`draft_id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8;

/*Data for the table `confirmation` */

/*Table structure for table `confirmation_basis` */

DROP TABLE IF EXISTS `confirmation_basis`;

CREATE TABLE `confirmation_basis` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '依据主键ID',
  `confirmation_id` int(11) NOT NULL DEFAULT '0' COMMENT '事实确认书ID',
  `basis_id` int(11) NOT NULL DEFAULT '0' COMMENT '工作底稿依据ID',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除（0未删|1删除）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=97 DEFAULT CHARSET=utf8;

/*Data for the table `confirmation_basis` */

/*Table structure for table `confirmation_content` */

DROP TABLE IF EXISTS `confirmation_content`;

CREATE TABLE `confirmation_content` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '发现问题内容ID',
  `confirmation_id` int(11) DEFAULT NULL COMMENT '事实确认书ID',
  `order` int(4) NOT NULL DEFAULT '0' COMMENT '排序序号',
  `type` enum('title','behavior','other') NOT NULL DEFAULT 'other' COMMENT '内容类型（behavior违规行为|title标题|other其他）',
