  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除（0未删|1已删）',
  PRIMARY KEY (`id`,`notice_id`)
) ENGINE=MyISAM AUTO_INCREMENT=527 DEFAULT CHARSET=utf8;

